	public int getHatchetId() {
		for (int i = 0; i < hatchetIds.length; i++) {
			if (getClient().playerEquipment[getClient().playerWeapon] == hatchetIds[i] || getClient().playerHasItem(hatchetIds[i])) {
				return hatchetIds[i];
			}
		}
		return -1;
	}

	public void sM(final int msgIndex) {
		switch (msgIndex) {
